description:
In 1947, in New Mexico, a radio operator receives a signal following patterns and while investigating the occurrence, he vanishes. In the present days, the same signal is transmitted from a base in Malvinas Island to United States of America, and a satellite captures images of a unknown object in Antartic. The cryptologist Julien Rome (James Spader) is invited to investigate the mystery in the South Pole, and he flies to a research base. While a team tries to open a weird shell probably from the outer space, Julien solves the message, indeed a distress signal ordering not to open the case.


